import React, { Component } from 'react';

class Header extends Component{
    render(){

        const{ navigation } = this.props;
        let navList = document.createElement("nav");
        navList.setAttribute("className", "navListBox");
        const headerList = navigation.map(navItem => {
            console.log(navItem.name);
            if (navItem.name === "header"){
               return(
                   <ul>
                        <li><a href="#">projects {navItem.links.illustration}</a></li>
                        <li><a href="#">art</a></li>
                        <li><a href="#">about</a></li>
                        <li><a href="#">contact</a></li>
                    </ul>
               )
            } else {
                return(
                    <ul>
                        <li><a href="#">dev</a></li>
                    </ul>
                )
            }
        })
        return (
            <header>
                { headerList } 
            </header>
        )
    }
}

export default Header;
